export const PUT_REGISTER_DATA = 'PUT_REGISTER_DATA';
export const PUT_FAILED_REGISTER_DATA = 'PUT_FAILED_REGISTER_DATA';
export const SEND_REGISTER_DATA = 'SEND_REGISTER_DATA';
export const SEND_LOGIN_DATA = 'SEND_LOGIN_DATA';
export const PUT_LOGIN_DATA = 'PUT_LOGIN_DATA';
export const PUT_FAILED_LOGIN_DATA = 'PUT_FAILED_LOGIN_DATA';


// Login
export const putLoginData = (data) => {
  return {
    type: PUT_LOGIN_DATA,
    payload: data
  };
}

export const putFailedLoginData = (data) => {
  return {
    type: PUT_FAILED_LOGIN_DATA,
    payload: data
  };
}

export const sendLoginData = (data) => {
  return {
    type: SEND_LOGIN_DATA,
    payload: data
  };
}


// Register
export const putRegisterData = (data) => {
  return {
    type: PUT_REGISTER_DATA,
    payload: data
  };
}

export const putFailedRegisterData = (data) => {
  return {
    type: PUT_FAILED_REGISTER_DATA,
    payload: data
  };
}


export const sendRegisterData = (data) => {
  return {
    type: SEND_REGISTER_DATA,
    payload: data
  }
}
